description:
Vanished

Science Documentary hosted by John Robinson, published by Discovery Channel broadcasted as part of DC Forensic Factor series in 2005 - English narration


Information
------------------------------

Investigators race against time to find a diabetic after he is kidnapped from his driveway - and must find him before he requires his insulin medication

